import React, { Component } from "react";
import Typical from "react-typical";

export class home extends Component {
  render() {
    return (
      <div>
        <style>{"body { background-color: #322F40; }"}</style>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "10rem",
            fontSize: 32,
            color: "white",
          }}
        >
          Welcome to ReFinance!
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "3rem",
            fontSize: 23,
            color: "white",
          }}
        >
          <Typical
            loop={Infinity}
            wrapper="b"
            steps={[
              "A new way to finance...",
              2000,
              "A new way to save...",
              2000,
              "A new way to grow...",
              2000,
            ]}
          />
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "3rem",
            fontSize: 10,
          }}
        >
          <a href="/login" class="btn btn-info">
            Login!
          </a>
          <a
            href="/signup"
            class="btn btn-info"
            style={{
              marginLeft: "1rem",
            }}
          >
            Sign Up!
          </a>
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "3rem",
            fontSize: 23,
            color: "white",
          }}
        >
          Learn how to correctly finance by setting out a proper budget!
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "3rem",
            fontSize: 23,
            color: "white",
          }}
        >
          Create savings, budgets and more!
        </div>
      </div>
    );
  }
}

export default home;
